import React from "react";
import Avatar from "./Avatar";

function Card(props){
    return(
        <div>
            <div className="card">
                <div className="top">
                    <h2 className="name">{props.name}</h2>
                    <Avatar img={props.img} />
                </div>
                <Details info={props.tel}/>
                <Details info={props.email}/>
            </div>
        </div>
    );
}

export default Card;
